style.css:
@-moz-document domain("amazon.com") {
body {
        background-image: url("https://i.pinimg.com/564x/7b/8a/c8/7b8ac8e08b580f81e95e507ba3f24441.jpg");
        background-size: cover;
        background-repeat: no-repeat;
        background-attachment: fixed;
    }

    /* Adjust text color and background for better readability */
    .a-color-base, .a-color-secondary, .a-text-normal, .a-link-normal {
        color: #000 !important;
    }

    .nav-a, .nav-a:hover, .nav-a:visited, .nav-a:active {
        color: #fff !important;
    }

    .nav-banner, .nav-subnav, .nav-progressive-content {
        background: rgba(0, 0, 0, 0.5) !important;
    }

    .s-main-slot, .s-desktop-content {
        background: rgba(255, 255, 255, 0.8) !important;
    }

    /* Style buttons for better contrast */
    .a-button, .a-button:hover, .a-button:active {
        background-color: #ff9900 !important;
        color: #fff !important;
    }
}
